import React from "react";
import Grid from "@material-ui/core/Grid";

const Home = () => {
  return (
    <Grid container direction="column" justify="flex-start" alignItems="center">
      <Grid item>
        <h1>Sarah Goon</h1>
      </Grid>
    </Grid>
  );
};

export default Home;
